import React from 'react';
import { ProjectsContainer, Title } from './ExampleElements';

const Example = () => {
  return (
      <ProjectsContainer id='projects'>
          <Title>
              Projects
          </Title>
          <ProjectsWrapper>
              <Project id={id}>
                  <ProjectDescription>
                      <Description>
                          {description}
                      </Description>
                      <GithubLink>
                          {githubLink}
                      </GithubLink>
                      <ProjectDemo>
                          {projectLink}
                      </ProjectDemo>
                  </ProjectDescription>
                  <ProjectImage src={img} alt={alt} />
              </Project>
          </ProjectsWrapper>
      </ProjectsContainer>
  );
};

export default Example;
